import React from "react";
import { Route, Routes } from "react-router-dom"; // Updated imports for v6
import styled from "styled-components";
import Navbar from "../components/Navbar";

// If HomePage and SettingsPage exist, make sure their paths are correct
import HomePage from "./HomePage";
import SettingsPage from "./SettingsPage";

const LayoutContainer = styled.div`
  display: flex;
`;

const ContentContainer = styled.main`
  flex-grow: 1;
  padding: 2rem;
`;

const Dashboard = ({ user }) => {
  return (
    <LayoutContainer>
      <Navbar user={user} />
      <ContentContainer>
        {/* Updated to use Routes instead of Switch */}
        <Routes>
          <Route path="/dashboard" element={<HomePage user={user} />} />
          <Route
            path="/dashboard/settings"
            element={<SettingsPage user={user} />}
          />
          {/* Define additional routes as needed */}
        </Routes>
      </ContentContainer>
    </LayoutContainer>
  );
};

export default Dashboard;
